  return (
    <>
      <Head>
        <title>Jose Murciano</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>

      <div class="wrapper">
        <Header
          activePage={activePage}
          setActivePage={setActivePage}
        />
        <Container fluid class="page">
          {children}
        </Container>

      </div>
    </>
  );
}

export default Layout;
